function Square({ value }) {
  const [pressed, setPressed] = useState("");

  function handleClick() {
    setPressed(pressed === "" ? "X" : "");
    console.log("clicked");
  }

  return (
    <button
      className="square"
      onClick={handleClick}
    >
      {pressed}
    </button>
  );
}
export default function Board() {

  return (
